from sympy import isprime, primerange
def ok(p):
  b = bin(p)[2:]
  for i in range(2, len(b)-1):
    if isprime(int(b[:i], 2)) and b[i] != '0':
      if isprime(int(b[i:], 2)) or ok(int(b[i:], 2)): return True
  return False
def aupto(lim): return [p for p in primerange(2, lim+1) if ok(p)]
